window.bookSummaryJSON = "<p><i>Duty Calls</i> continues the story of Nic, Mal, Jazz, and Jade as they fight to hold what belongs to them. The Corporations are becoming more aggressive in their effort to steal their inventions. Our four friends are matching the corporate's aggression blow for blow. The fight has already turned deadly, and the Corporation has shown they aren't afraid to spill blood. Nic has shown restraint, but the gloves are about to come off. They've gone after his family, and that's the one thing he will not tolerate.</p>"; 
